import {BrowserRouter, Routes, Route,} from 'react-router-dom';

import App from './App.js'
import Layout from './Layout.js'

export default function Links() {

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout/>}>
          <Route index element={<App/>} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}
